import React from "react";
import "./Header.css";

const Header = ({ toggleSidebar }) => {
    return (
        <header className="header bg-primary text-white">
            <div className="d-flex align-items-center">
                <i className="fas fa-bars me-3" onClick={toggleSidebar}></i>
                <img src="/logo.png" alt="Logo" className="logo me-2" />
                <h3>BTO AdayBilgi</h3>
            </div>
            <nav className="header-links d-flex align-items-center">
                <a href="#">Anasayfa</a>
                <a href="#">Onay Beklenen İşlemler</a>
                <a href="#">Yaklaşan Etkinlikler</a>
                <i className="fas fa-bell ms-3"></i>
                <div className="user-info">
                    <span>Boray Güvenç</span>
                    <div>Koordinatör</div>
                    <i className="fas fa-chevron-down ms-2"></i>
                </div>
            </nav>
        </header>
    );
};

export default Header;
